Dalam rangka memeriahkan HUT ke-80 Republik Indonesia, Dinas Lingkungan Hidup (DLH) Kota Bekasi melaksanakan penilaian Lomba Gapura tingkat Kota Bekasi dengan Tema Barang Bekas. Pada kesempatan ini, RT 003 RW 005 Kelurahan Cikiwul menjadi perwakilan Kelurahan Cikiwul untuk mengikuti lomba tersebut.

Tim penilai dari DLH Kota Bekasi hadir didampingi oleh Lurah Cikiwul, Babinsa, Bimaspol, Ketua RW, para Ketua RT, pengurus LPM, kader, serta warga masyarakat RT 003 RW 005.

Kegiatan ini tidak hanya menumbuhkan semangat kebersamaan warga, tetapi juga mengedukasi masyarakat tentang pentingnya pengelolaan barang bekas menjadi karya yang bermanfaat, estetis, dan ramah lingkungan. Rabu (20/8) 

