Dalam rangka memperingati Hari Jadi ke-80 Provinsi Jawa Barat yang jatuh pada tanggal 19 Agustus 2025, Pemerintah Kota Bekasi turut serta memeriahkan karnaval dipimpin langsung oleh Wali Kota Bekasi @mastriadhianto beserta Wakil Wali Kota Bekasi @harris.bobihoe . Camat Bantargebang beserta Ketua TP PKK Kecamatan turut hadir dalam rangkaian acara peringatan yang digelar Pemerintah Provinsi Jawa Barat.

Turut mendampingi, Lurah Cikiwul bersama Ketua TP PKK Kelurahan Cikiwul yang ikut serta menghadiri acara tersebut sebagai bentuk dukungan dan kebersamaan dalam merayakan momentum bersejarah bagi masyarakat Jawa Barat.

Dengan mengusung tema ‚ÄúBerkreasi dalam kemajuan, Seimbang untuk keberlanjutan‚Äù, peringatan Hari Jadi ke-80 Provinsi Jawa Barat menjadi refleksi perjalanan panjang pembangunan sekaligus komitmen untuk terus berinovasi dalam mewujudkan kesejahteraan masyarakat yang berkelanjutan. Selasa (19/8) 

