Dalam rangka memeriahkan Malam Puncak HUT ke-80 Republik Indonesia, warga Kelurahan Cikiwul menggelar acara hiburan, pembagian hadiah perlombaan, serta doorprize yang berlangsung meriah dan penuh kebersamaan.

Kegiatan ini dimonitoring langsung oleh Lurah Cikiwul bersama Ketua LPM, Babinsa, dan Pamor, serta didampingi para Ketua RT dan RW setempat. Kehadiran unsur pemerintah dan masyarakat ini menjadi wujud sinergi dalam mendukung kegiatan positif yang mempererat persatuan dan kebersamaan warga.

Acara berlangsung dengan penuh semangat kebangsaan, ditandai dengan antusiasme masyarakat yang tinggi, baik dalam mengikuti hiburan maupun saat pembagian hadiah dan doorprize.

Kelurahan Cikiwul berharap kegiatan ini dapat terus memperkuat tali silaturahmi, meningkatkan semangat gotong royong, serta menjadi momentum untuk menumbuhkan rasa cinta tanah air di tengah masyarakat. Minggu (17/8) 

