Pemerintah Kota Bekasi menyelenggarakan Upacara Penurunan Bendera Merah Putih dalam rangka memperingati Hari Ulang Tahun ke-80 Kemerdekaan Republik Indonesia yang berlangsung di Alun-Alun M. Hasibuan Kota Bekasi, Minggu (17/8).

Pada kesempatan ini, Wakil Wali Kota Bekasi bertindak sebagai Inspektur Upacara, memimpin jalannya prosesi dengan khidmat dan penuh semangat kebangsaan.

Turut hadir dalam kegiatan ini para pejabat Forkopimda, Camat, Lurah, tokoh masyarakat, serta perwakilan organisasi kemasyarakatan. Lurah Cikiwul hadir dan mengikuti jalannya upacara bersama jajaran perangkat kelurahan serta unsur masyarakat.

Upacara penurunan bendera ini menjadi momentum untuk memperkuat persatuan dan kebersamaan seluruh elemen masyarakat Kota Bekasi dalam mengisi kemerdekaan dengan kerja nyata menuju Indonesia maju.

