Dalam rangka memeriahkan Hari Kemerdekaan ke-80 Republik Indonesia, warga RW 006 Kelurahan Cikiwul bersama jajaran RT/RW, tokoh masyarakat, serta elemen warga lainnya melaksanakan berbagai rangkaian kegiatan. Kegiatan dimulai dengan Upacara Pengibaran Bendera Merah Putih yang berlangsung khidmat, dilanjutkan dengan berbagai perlombaan tradisional dan modern yang diikuti dengan antusias oleh anak-anak hingga orang dewasa.

Sebagai puncak acara, warga turut menggelar Karnaval Kemerdekaan yang menampilkan kreativitas, semangat persatuan, serta kekayaan budaya masyarakat setempat.

Rangkaian kegiatan ini tidak hanya menjadi wujud syukur atas kemerdekaan bangsa, tetapi juga mempererat kebersamaan, gotong royong, dan rasa nasionalisme di lingkungan RW 006 Kelurahan Cikiwul. Minggu (17/8) 

